create table if not exists records(pid varchar(64) not null constraint records_pk primary key, content jsonb not null, deleted boolean default false not null, trackingid varchar(256) default ''::character varying not null, created    timestamp with time zone constraint created_not_null check (created IS NOT NULL), modified timestamp with time zone constraint modified_not_null check (modified IS NOT NULL));
create index if not exists records_content on public.records using gin (content jsonb_path_ops);
create index if not exists records_created on public.records (created);
create index if not exists records_modified on public.records (modified);
update records set modified = now();
commit;
